$(document).ready(function() {
    const MutationObserver = window.MutationObserver || window.WebKitMutationObserver;
    const observer = new MutationObserver(function(mutationRecords) {
        mutationRecords.forEach(function (mutation) {
            if($(mutation.target).is('i') || $(mutation.target).is('svg')) $.transformIcon($(mutation.target));
            _.forEach($(mutation.addedNodes), function(e) {
                if($(e).is('i') || $(e).is('svg')) $.transformIcon($(e));
            });
        });
    });

    observer.observe(document, { childList: true, characterData: true, attributes: true, subtree: true });

    $(document).on('click', '.select2', function() {
        $.each($('i'), (i, e) => $.transformIcon($(e)));
    });

    // TODO: Temporary
    setInterval(function() {
        $.each($('i'), (i, e) => $.transformIcon($(e)));
    }, 100);
});

$(document).on('page:ready', function() {
    $.each($('i'), (i, e) => $.transformIcon($(e)));
});

